import axios from "axios";

const TODO_API_BASE_URL = "http://localhost:8080/color";

export const getColor = () => axios.get(TODO_API_BASE_URL);

export const clickColor = (color) =>
  axios.put(
    TODO_API_BASE_URL,
    { color: color },
    {
      headers: {
        "Content-Type": "application/json",
      },
    }
  );
